import Nav from '../components/Nav';
import ChatBox from '../components/Chatbox'
import Sidebar from '../components/Sidebar';
import React from 'react'


const Main = () => {
  return (
    <div >
      <div class='main'>
        <Nav />
      <div class='sidebar'>
        < Sidebar/>
      </div>
      <div class='mainbar'>
        <ChatBox />
      </div>
      </div>
    </div>
  )
}

export default Main
